//import logo from './logo.svg';
import "./App.css";
//import Header from "./components/Header";
//import AddPost from "./components/AddPost";
import Urheilijat from "./components/Urheilijat";
import AddUrheilija from "./components/AddUrheilija";
import EditUrheilija from "./components/EditUrheilija";
import DeleteUrheilija from "./components/DeleteUrheilija";
import FindUrheilija from "./components/FindUrheilija";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useRoutes,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <AddUrheilija />
              </>
            }
          />
          <Route
            path="/add"
            element={
              <>
                <EditUrheilija />
              </>
            }
          />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
